--
-- TOC entry 179 (class 1259 OID 31338)
-- Name: componentidomanda; Type: VIEW; Schema: iscritto; Owner: iscritto
--

CREATE VIEW iscritto.componentidomanda AS
 SELECT DISTINCT s.cognome,
    s.nome,
    s.data_nascita,
    s.codice_fiscale,
    s.sesso,
    s.id_domanda_iscrizione,
    s.id_anagrafica_soggetto,
    s.id_rel_parentela,
    s.id_comune_nascita,
    s.id_stato_nascita,
    s.ora_nascita,
    s.fl_residenza_nao,
    ts.cod_tipo_soggetto,
    p.cod_parentela
   FROM (((iscritto.iscritto_t_anagrafica_sog s
     LEFT JOIN iscritto.iscritto_r_soggetto_rel r ON ((s.id_anagrafica_soggetto = r.id_anagrafica_soggetto)))
     RIGHT JOIN iscritto.iscritto_d_tipo_sog ts ON ((ts.id_tipo_soggetto = r.id_tipo_soggetto)))
     LEFT JOIN iscritto.iscritto_d_relazione_par p ON ((p.id_rel_parentela = s.id_rel_parentela)));


ALTER TABLE iscritto.componentidomanda OWNER TO iscritto;

