/*
ID_CONDIZIONE_PUNTEGGIO = 5
4.	Minore in situazione di disagio sociale ( PA_SOC ).
    Assegnazione se ISCRITTO_T_DOMANDA_ISC.fl_servizi_sociali=’S’ esiste un record nella tabella ISCRITTO_T_SERVIZI_SOC
*/
CREATE OR REPLACE
